import React from "react";
import Navigation from "../Layout/Navigation";
import Footer from "../Layout/Footer";
import About from "./About";
import ContactUs from "./ContactUs";

const Home = () => {
  return (
    <>
      <Navigation />
      <About/>
      <ContactUs/>
      <h1>This is Home Page</h1>
      <Footer />
    </>
  );
};

export default Home;
